  class Backend {
      static async init(serverAPI) {
          this.serverAPI = serverAPI;
          this.applyCount = 0;
      }
      static async getSteamIndex() {
          var steamindex = 0;
          await this.serverAPI.callPluginMethod("get_steamIndex", {}).then(res => {
              if (res.success) {
                  steamindex = res.result;
              }
          });
          return steamindex;
      }
      static reloadConfig() {
          this.serverAPI.callPluginMethod("ReloadConfigPath", {}).then(res => {
              if (res.success) {
                  console.debug("ReloadConfigPath = " + res.result);
              }
          });
      }
      static applyConfig(index, config) {
          this.applyCount = this.applyCount + 1;
          //取200ms内的最后一次覆写请求，防止连续写入导致mangoapp闪退
          setTimeout(() => {
              this.applyCount = this.applyCount - 1;
              if (this.applyCount == 0) {
                  this.serverAPI.callPluginMethod("SetOverwriteConfig", { "index": index, "config": config });
              }
          }, 200);
      }
      static applyConfigs(configs) {
          this.serverAPI.callPluginMethod("SetOverwriteConfigs", { "configs": configs });
      }
  }

